import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css';
import { HashRouter as Router, Route} from "react-router-dom";


ReactDOM.render(
    <Router>
        <Route component={App} />
    </Router>
    , document.getElementById('root'));
